import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import {CustomButton} from "../CustomButton/CustomButton";

export const WishCard = ({item}) => {

    console.log(item)
    return (
        <Row>
            <Col>
                <img src="" alt=""/>
            </Col>
            <Col>
                {item.title}
            </Col>
            <Col>
                {item.units_in_stock}
            </Col>
            <Col>
                {item.price}
            </Col>
            <Col>
                <CustomButton/>
            </Col>
            <Col>
                <CustomButton/>
            </Col>
        </Row>
    )
}
